function SportCarPage() {

    const [sportCar, setSportCar] = useState([]);

    useEffect (() => {
        fetch("http://localhost:3000/sportcars")
          .then((r) => r.json())
          .then((sportData) => {
            setSportCar(sportData)
          })
    }, [])

    return (
        <div>
            <SportCarCollection />
        </div>
    )
}

